import React from 'react';
import LeftChoiceShape from './LeftChoiceShape'
import LeftChoiceFace from './LeftChoiceFace';
import LeftChoiceHair from './LeftChoiceHair';
import LeftChoiceAccessories from './LeftChoiceAccessories';

const LeftOptionsNav = () => {      
    return (
            <ul className="left_options">
                <li class="left_option show_shape">shape</li> 
                <li class="left_option show_face">face</li>
                <li class="left_option show_hair">hair</li>
                <li class="left_option show_accessories">accessories</li>
            </ul>
    );
}

export default LeftOptionsNav
